records.addlTxt:
Plea hearing proceeds.  Defendant was advised of constitutional rights and maximum penalties, and further advised that if not a United States citizen deportation is possible. Defendant sworn, examined as to plea, and entered a plea of guilty.  Court found defendant freely, voluntarily and intelligently waived all constitutional rights. Plea questionnaire waiver of rights and addendum to plea questionnaire received and filed. Parties stipulated to the criminal complaint as factual basis to sustain defendant's plea. Court found defendant guilty of Counts 1 and 2 as charged in the Amended Information and ordered a Judgment of Conviction be entered into the record.  

Sentencing proceeded.  Statements by the State, defense and defendant.  The defendant imposed the following:

AS TO COUNT 01:
The Court imposed but stayed 9 months at the House of Correction, consecutive to Count 2, and placed defendant on probation for two (2) years.  Court allowed Huber for work and child care; good time allowed, with credit for 2 days time served.
 * Court ordered defendant to provide a DNA sample and pay the surcharge.

AS TO COUNT 02:
The Court imposed but stayed 6 months at the House of Correction, with Huber for child care and work, if employed, good time allowed; and placed defendant on probation for 2 years, concurrent to Count 1.
 * Court ordered defendant to pay a fine in the amount of $1,800.00.
 * Court ordered defendant to pay a DNA surcharge.
 * DNA sample ordered in Count 1.
 * Court ordered a two-year driver's license revocation;
 * Court ordered defendant to have a two-year ignitition interlock with allowance to pay the reduced fees for ignition interlock as requested by defense counsel. 
 * Complete a driver assessment and safety plan.  Court Order for IDP Related Safety Plan, signed and filed. Copy provided to defendant.

CONDITIONS OF PROBATION ON COUNTS 1 AND 2:
 - Undergo a mental health evaluation; follow thur with any treatment recommended;
 - No controlled substances other than those legally prescribed for defendant by a duly licensed physician for her mental or physical needs; take as prescribed and for only as long as deemed medically reasonable and necessary;
 - No alcohol;
 - Urine screens to ensure compliance;
 - Parenting classes;
 - Cognitive thinking intervention counseling;
 - Seek and maintain employment;
 - Job and vocational training;
 - No contact with the victim, Kay W.;
 - Pay the DNA surcharges, the fine ordered in Count 2, plus all other costs and disbursements.  Failure to pay would result in a civil judgment entered against defendant.
